    DataServiceProvider.prototype.loadLanguageData = function (langType) {
        var _this = this;
        console.log("Access loadLanguageData " + langType);
        return new Promise(function (resolve) {
            //this.http.get('../assets/data/workorderdata.json')
            var url = null;
            if ('bhs' == langType) {
                url = '../www/assets/data/libBahasa.json';
            }
            else {
                url = '../www/assets/data/libEnglish.json';
            }
            _this.http
                .get(url)
                .map(function (res) { return res.json(); })
                .subscribe(function (data) {
                // we've got back the raw data, now generate the core schedule data
                // and save the data for later reference
                _this.requestStatus = data;
                console.log("data of load java LPC : " + data.length);
                console.log('date json..  ' + JSON.stringify(_this.requestStatus));
                resolve(_this.requestStatus);
            });
        });
    };
